import{_ as a,c as e,o as t,ap as r}from"./chunks/framework.Dklddx0T.js";const i="/assets/15.D4qSjwPo.jpg",g=JSON.parse('{"title":"2024 年","description":"","frontmatter":{},"headers":[],"relativePath":"article/milestone/3.md","filePath":"article/milestone/3.md","lastUpdated":1724149794000}'),l={name:"article/milestone/3.md"},o=r('<h1 id="_2024-年" tabindex="-1">2024 年 <a class="header-anchor" href="#_2024-年" aria-label="Permalink to &quot;2024 年&quot;">​</a></h1><h2 id="_2024-01-04" tabindex="-1">2024-01-04 <a class="header-anchor" href="#_2024-01-04" aria-label="Permalink to &quot;2024-01-04&quot;">​</a></h2><p>2023 年一整年都没有记录，哈哈，今年开始记录一些内容吧。</p><p>最近开始写 2023 的年度总结、学习 react、学习服务端，再写一些自己的项目，最近事情还挺多的。</p><h2 id="_2024-01-29" tabindex="-1">2024-01-29 <a class="header-anchor" href="#_2024-01-29" aria-label="Permalink to &quot;2024-01-29&quot;">​</a></h2><p>最近开始学学 Swift，对这个语言还是很感兴趣</p><h2 id="_2024-01-31" tabindex="-1">2024-01-31 <a class="header-anchor" href="#_2024-01-31" aria-label="Permalink to &quot;2024-01-31&quot;">​</a></h2><p>今天是 1 月份的最后一天，我正式开始学习了 swift，今天晚点把记录的笔记都整理下，还有之前的 react 笔记都整理下</p><h2 id="_2024-03-12" tabindex="-1">2024-03-12 <a class="header-anchor" href="#_2024-03-12" aria-label="Permalink to &quot;2024-03-12&quot;">​</a></h2><p>时间过的可真快，一转眼过完年就三月份了。</p><p>上周末去线下交易了一台 Macbook Air，最近用起来非常的不错，最近一直在学习 Swift</p><h2 id="_2024-03-15" tabindex="-1">2024-03-15 <a class="header-anchor" href="#_2024-03-15" aria-label="Permalink to &quot;2024-03-15&quot;">​</a></h2><p>这两天开始使用 Swift 写了一个小红书项目 <a href="https://github.com/Tyh2001/small-red-book" target="_blank" rel="noreferrer">small-red-book</a></p><h2 id="_2024-03-25" tabindex="-1">2024-03-25 <a class="header-anchor" href="#_2024-03-25" aria-label="Permalink to &quot;2024-03-25&quot;">​</a></h2><p>今天写了 <a href="https://blog.tianyuhao.cn/article/article/23.html" target="_blank" rel="noreferrer">开端</a></p><h2 id="_2024-04-03" tabindex="-1">2024-04-03 <a class="header-anchor" href="#_2024-04-03" aria-label="Permalink to &quot;2024-04-03&quot;">​</a></h2><p>时间真快，最近事情越来越多，明天是清明节放假，打算去上海玩。</p><p>今天将 swift 真机预览搞定了，写了笔记。</p><p>今天看群里一些人说国内原生 IOS 开发已经凉了，新手是找不到工作的。但是其实对我来说无所谓，我并没有指望靠 Swift 在国内可以找到工作。</p><h2 id="_2024-04-17" tabindex="-1">2024-04-17 <a class="header-anchor" href="#_2024-04-17" aria-label="Permalink to &quot;2024-04-17&quot;">​</a></h2><p>又快要到五一了，今天 10:30 就要抢五一到票了，还没想好去哪里。</p><p>最近的的事情还挺多，有时候忙的都不知道该干什么了，这里列举一下：</p><ol><li><p>完善 <a href="https://github.com/FightingDesign/fighting-design" target="_blank" rel="noreferrer">fighting-design</a> 的一些细节，和单元测试覆盖率。不新增组件了，只是将现有的组件维护好，更加健壮就可以了。</p></li><li><p>学英语。电脑使用 <a href="https://earthworm.cuixueshe.com" target="_blank" rel="noreferrer">earthworm</a> 学习，手机使用多邻国和看一些抖音的英语听力练习，将学习的新句子和单词会记录到这个博客上面，现在还有好多截图还都没有记录完成。</p></li><li><p>学习 Swift，我的 Swift 项目还要保持一个很快的更新节奏，学习更多的开发流程和方式。</p></li><li><p>淘宝店。最近开通了淘宝店，打算开启前端代做、文案代写等服务，昨天刚刚上架了商品，现在还有很多问题需要处理。之前没有这方面的经验，还需要多研究才行。</p></li><li><p>对于自由职业的一些思考。希望可以学习更多的东西，希望在未来一年中可以找到一份远程的工作。</p></li><li><p>最近有时间会把自己的人生经历记录下来，写成了 <a href="https://blog.tianyuhao.cn/article/storybook/1.html" target="_blank" rel="noreferrer">storybook</a> 放在这里。</p></li><li><p>其它需求：我需要办理一张中国香港的银行卡（汇丰银行）、对 AI 领域再深入一些可以有一些 AI 相关的作品、上架一款 IOS APP。</p></li><li><p>还有一些生活相关的事情。</p></li></ol><h2 id="_2024-04-18" tabindex="-1">2024-04-18 <a class="header-anchor" href="#_2024-04-18" aria-label="Permalink to &quot;2024-04-18&quot;">​</a></h2><p>今天将我自己的产品邀请了一位志同道合的开发者一起开发，所有的源代码均已公开，希望后面可以遇到更多<strong>崇尚自由</strong>的开发者一起加入其中，加油。</p><h2 id="_2024-04-30" tabindex="-1">2024-04-30 <a class="header-anchor" href="#_2024-04-30" aria-label="Permalink to &quot;2024-04-30&quot;">​</a></h2><p>时间真快，这是 2024 年 4 月的最后一天了，明天就是五一劳动节了，也没有想好去哪里玩。</p><p>今天将 <a href="https://github.com/FightingDesign/fighting-design" target="_blank" rel="noreferrer">fighting-design</a> 发布了 <a href="https://github.com/FightingDesign/fighting-design/releases/tag/v1.0.0-alpha.1" target="_blank" rel="noreferrer">v1.0.0-alpha.1</a> 版本，正式进入 alpha 版本！今天仓库也提交到 400 次了。</p><p><img src="'+i+'" alt=""></p><h2 id="_2024-07-12" tabindex="-1">2024-07-12 <a class="header-anchor" href="#_2024-07-12" aria-label="Permalink to &quot;2024-07-12&quot;">​</a></h2><p>感觉最近一年来，我：</p><p>👉从专注开源开发，转型到了独立产品开发； 👉从专注 web 开发，转型到了专注 app 开发； 👉从专注 vue 开发，转型到了 react 和 swift 开发。</p>',32),h=[o];function n(s,p,c,_,d,f){return t(),e("div",null,h)}const u=a(l,[["render",n]]);export{g as __pageData,u as default};
